import React, { Component } from 'react';
import '../css/extra.css';

const ExtraSkill = (props) => {
    const { skillArray } = props;
    return (
        <ul>
            {skillArray.map((skill) => {
                return (
                    <div className="flexwrap">
                        <div className="wrapperEdu">
                            <div className="desc" contentEditable="true">{skill.desc}</div>
                        </div>
                    </div>
                );
            })}
        </ul>
    );
}

const ExtraInterest = (props) => {
    const { interestArray } = props;
    return (
        <ul>
            {interestArray.map((interest) => {
                return (
                    <div className="flexwrap">
                        <div className="wrapperEdu">
                            <div className="desc" contentEditable="true">{interest.desc}</div>
                        </div>
                    </div>
                );
            })}
        </ul>
    );
}

export default {ExtraSkill, ExtraInterest}
